import { enumStatus, enumTypes, exchangedType } from "@configs";

export interface IBenefit {
    exchangedType?: exchangedType,
    updatedAtHistory:Date|string,
    idCart?: string,
    _id?: string;
    levelIds: Array<string>;
    status: enumStatus;
    name: string;
    quantity?: number;
    limit?: number;
    imageUrl: string[];
    description: string;
    startDate: string | Date;
    endDate: string | Date;
    birthMonths: Array<string>;
    createdAt?: string;
    updatedAt?: string;
    type?:enumTypes;

}
